import * as jsPDF from "jspdf";

export class Filemanagement {

    public static downloadPDF(innerHTML: string){

      let doc = new jsPDF();
      let file = "fileUploadError"+new Date()+".pdf";
      let  specialElementHandlers = {
        '#editor': function (element, renderer) {
          return true;
        }
      };

      var imgData = new Image();
      imgData.src ='data:image/jpeg;base64,';
      doc.addImage(imgData, 'JPEG', 8, 20, 50, 15);
      doc.setDrawColor(150,150,150);
      //doc.text('Rapport derreur',x:20,y:30,w:40,h:30);

      doc.text('Rapport d\' Erreur',85,40,null,null,null);
      doc.line(17, 45, 200, 45);
      doc.fromHTML(innerHTML, 17, 45, {
        'width': 190,
        'elementHandlers': specialElementHandlers,
      });

      doc.save(file);

  }

  public static downloadPDFModules(innerHTML: string){

    let doc = new jsPDF();
    let file = "fileUploadError"+new Date()+".pdf";
    let  specialElementHandlers = {
      '#editor': function (element, renderer) {
        return true;
      }
    };

    var imgData = new Image();
    imgData.src ='data:image/jpeg;base64,';
    doc.addImage(imgData, 'JPEG', 8, 20, 50, 15);
    doc.setDrawColor(150,150,150);
    //doc.text('Rapport derreur',x:20,y:30,w:40,h:30);

    doc.text('Rapport d\' Integration des Modules',68,40,null,null,null);
    doc.line(17, 45, 200, 45);
    doc.fromHTML(innerHTML, 17, 45, {
      'width': 190,
      'elementHandlers': specialElementHandlers,
    });

    doc.save(file);

  }

}
